Thunderstone Mine: DC 15 to find, DC 15 to disable;
    affects all targets within 20 ft., DC 18 save or take 4d10 thunder damage
    and become deafened for 1d4 rounds

west.trap:
Acid Spray: DC 10 to find, DC 15 to disable;
    affects all targets within a 20 ft. cone, DC 15 save or take 1d10 acid damage
    for 1d4 rounds
